#transition probability (one node HMM)
TransProb = 0.997151

def get_score(seq):
    score = 0.0
    for sym in seq:
        #print sym, score
        score += math.log(Emissions[sym], 2)
        score += math.log(TransProb, 2)
    return score

def get_score_default(seq, alpha=Amino):
    #assume transition of 1.0 and emission of 1/|S|
    escore =  math.log(1.0/len(alpha), 2)
    transcore = math.log(0.9999,2)
    score = (escore+transcore) * len(seq)
    return score


